$.fn.extend({
	
	setSelectSkin: function (arg) {
		var zIndexCtrl; 
		$(document).click ( function (e) {
			if ( $(e.currentTarget).parent(".select-wrapper").size() == 0 && !$(e.currentTarget).is(".select-wrapper")) {
				$(".select-dropdown").hide ();
			}
		});
		return this.each ( function () {
			var _sel = $(this);
			var dropdown = $('<ul class="select-dropdown"></ul>').css ("width", $(this).width() - 5);
			_sel.find ("option").each ( function () {
				$(dropdown)
					.append(
						$('<li val="'+$(this).attr("value")+'"><a>'+$(this).text()+'</a></li>')
						.click ( function (e) {
							e.stopPropagation ();
							$(this).parents(".select-wrapper:first")
								.find(".select-label span")
									.html($(this).find("a").text());
							$(this).parents(".select-wrapper:first")
								.find("[name="+_sel.attr ("name")+"]").val($(this).attr ("val"));	
							$(".select-dropdown").hide ();
						})
					);
			});
			$(this).append ( dropdown );
			var w = $('<div class="select-wrapper"><input type="hidden" name="'+$(this).attr ("name")+'" value="'+$(this)
						.find("option:selected").val()+'" /></div>')
						.click(function(e){
							$(".select-dropdown").hide();
							e.stopPropagation();
							$(this).find(".select-dropdown").toggle();
						})
						.append($('<div class="select-label"><span>'+$(this).find("option:selected").text()+'</span></div>'))
						.append(dropdown)
						.css({"width":$(this).width()+10});
			$(this).replaceWith (w);
		});
	},
	
	setCheckboxSkin: function () {
		return this.each ( function () {
			var w = $('<div class="check-wrapper"><input type="hidden" name="'+$(this).attr ("name")+'" value="'+$(this).is(":checked")+'" /></div>')
						.click ( function () {
							$(this).toggleClass ("checked");
							$(this).find ( "input" ).val ( $(this).hasClass ("checked") );
						});
			$(this).replaceWith (w);
		});
	}
	
});

